$(function() {
	///////////////////////////////////////////////////
	/////////////////////multitaferas//////////////////
	///////////////////////////////////////////////////

	(function startObservation() {
		var target = document.body;
		var observer = new MutationObserver(function(mutations) {
			addEventListener2();
		});
		var config = {
			childList: true,
			subtree: true
		};
		observer.observe(target, config);
	})();

	function addEventListener2() {
		$(".giveaway-links").each(function() {
			//if (!$(this).has(".abrirgl").length) {
			if (!$(this).closest(".abrirgl").length) {
				$(this).wrap("<a class='abrirgl' rel='nofollow' target='_blank' href='"+$(this).attr("data-href")+"'/>");
			}
			$(this).removeClass("giveaway-links").addClass("giveawaylinks");
			$(".giveawaylinks a:not('[target]')", $(".col-2-3")).attr({target:"_blank",rel:"nofollow"}); //Sempre abrir aba em uma nova janela*/
			$("span.icon-contributor").closest(".giveawaylinks").attr("style", "visibility: hidden !important; display: none !important;"); //Esconder contributor giveaways
			$("span.copies", $(".col-2-3")).closest(".giveawaylinks").not("[style]").css("box-shadow", "inset 0px 0px 0px 4px #930000"); //Destaca giveaway com varias copias
		});
		$("#remove_entries, a.notification.regular-button:contains('Need Base Game')").each(function() { //fecha abas
			setTimeout(window.close, 10);
		});
	}


	$(window).load(function() {
		$("#enter-giveaway").each(function() {//entra no giveaway
			$(this).trigger("click");
		});
	});
	///////////////////////////////////////////////////
	//////////////////Scroll infinito//////////////////
	///////////////////////////////////////////////////

	(function onPageLoad() {
		var pagesLoaded = 1;
		var splitPageLinkCheck = $(".pagination").find("a:contains('Next')");
		if (splitPageLinkCheck.length == 0) {
			pagesLoaded = 999;
		}

		function loadPage() {
			if (pageNumber > lastPage) {
				loadingNextPage = true;
				pagesLoaded = 999;
			}
			if (loadingNextPage == false) {
				loadingNextPage = true;
				$("<div>").load(pageLink + pageNumber + " .giveaway-links", function() {
					$(".col-2-3").last().append($(this).html());
					pageNumber++;
					pagesLoaded++;
					loadingNextPage = false;
				});
			}
		}

		if (splitPageLinkCheck.length > 0) {
			var splitPageLink = splitPageLinkCheck.attr("href").split("page=");
			var pageLink = splitPageLink[0] + "page=";
			var pageNumber = parseInt(splitPageLink[1]);
			var splitLastPageLinkCheck = $(".arrow > a");
			var splitLastPageLink = splitLastPageLinkCheck.attr("href").split("page=");
			var lastPage = parseInt(splitLastPageLink[1]);
			var loadingNextPage = false;
			if ($(".pagination").length) {
				$(".pagination").hide();
			}
			$(window).scroll(function() {
				if ($(window).scrollTop() + $(window).height() > $(document).height() - 600) {
					loadPage();
				}
			});
		}
	})();

	///////////////////////////////////////////////////
	///////////painel lateral acompanha scroll/////////
	///////////////////////////////////////////////////
	$("<style>").text(".sc-bg-sidebar {visibility: hidden !important; display: none !important;}").appendTo("body"); //remove mensagem ads

	(function() {
		if (!$("aside")) return;

		var sbWidth = $("aside").offsetWidth;
		fixToTop();
		addEventListener("scroll", fixToTop, false);

		var lm = $("#hero").offsetHeight;
		if ($("#page-wrapper>main>.content-bg.content-wrapper").offsetHeight != undefined) {
			lm = lm + 20 + $("#page-wrapper>main>.content-bg.content-wrapper").offsetHeight;
		}

		function fixToTop() {
			if (pageYOffset >= lm) {
				$("aside").setAttribute("style", "position: fixed; top: 41px; max-width: 360px;");
				$(".col-2-3").setAttribute("margin-left: " + sbWidth + "px;");
			} else {
				$("aside").removeAttribute("style");
				$(".col-2-3").removeAttribute("style");
			}
		}

		function $(aSelector, aNode) {
			return (aNode ? aNode : document).querySelector(aSelector);
		}
	})();
});